const randomImage = () => {
    return characterImages[Math.floor(Math.random() * (characterImages.length))];
}

const capitalize = (s) => {
    if (typeof s !== 'string') return ''
    return s.charAt(0).toUpperCase() + s.slice(1)
};

const randomDate = (year) => {
    let start = new Date(year, 0, 1);
    let end = new Date(year, 11, 31);
    var date = new Date(+start + Math.random() * (end - start));
    return date;
}

const pickRandom = (arr) => {
    let count = Math.floor(Math.random() * (arr.length - 2 + 1)) + 2;
    let _arr = [...arr];
    return [...Array(count)].map(() => _arr.splice(Math.floor(Math.random() * _arr.length), 1)[0]);
}

const getRandomCordinates = (lat) => {
    let from, to;
    if (lat) {
        from = 45.3;
        to = 45.6;
    }
    else {
        from = 9;
        to = 9.3;
    }
    return (Math.random() * (to - from) + from).toFixed(3) * 1;
}

