async function deleteData(userId) {
    let chronicle = await Chronicle.findOne({ storyTeller: userId });
    if (chronicle) {
        await Session.deleteMany({ storyTeller: userId });
        await Story.deleteMany({ storyTeller: userId });
        await Character.deleteMany({ chronicleId: chronicle._id });
        await Player.deleteMany({ chronicleId: chronicle._id });
        await Coterie.deleteMany({ userId: userId });
        await Chronicle.deleteMany({ storyTeller: userId });
        if (env === "dev") {
            await User.deleteMany({
                _id: {
                    $ne: userId
                }
            });
        }
    }
}

async function importData(userId) {
    let i, j;
    var user = await User.findById(userId);
    if (user) {
        let chronicle = await createChronicle(userId);

        let players = [];

        // create players
        for (i = 0; i < 6; i++) {
            let player;
            if (i === 0) {
                player = await createPlayer(chronicle._id, "108668813638654349097");
            }
            else {
                player = await createPlayer(chronicle._id);
            }
            players.push(player);
            chronicle.players.push(player);
        }
        await chronicle.save();

        // create stories
        for (i = 0; i < 5; i++) {
            let story = await createStory(chronicle);
            await story.save();
            let year = "201" + (i + 4).toString();
            let sessionsLength = 10 + Math.floor(Math.random() * 20);
            for (j = 0; j < sessionsLength; j++) {
                let session = await cerateSession(story, players, parseInt(year))
                story.sessions.push(session);
            }
            await story.save();
        }

        // create coteries
        for (i = 0; i < 6; i++) {
            let coterie = await createCoterie(chronicle._id, userId);

            let coterieLength = 3 + Math.floor(Math.random() * 5);

            for (j = 0; j < coterieLength; j++) {
                let character = await createCharacter(chronicle._id, userId);
                coterie.characters.push(character);
            }
            await coterie.save();
            chronicle.coteries.push(coterie);
        }

        // create attachment
        for (i = 0; i < 10; i++) {
            let attachment = await createAttachment(chronicle._id, userId, players);

            await attachment.save();
            chronicle.attachments.push(attachment);
        }

        // create places
        for (i = 0; i < 10; i++) {
            let place = await createPlace(chronicle._id, userId, players);

            await place.save();
            chronicle.places.push(place);
        }

        await chronicle.save();
    }
}

async function cerateSession(story, players, year) {
    let session = new Session({
        sessionDate: randomDate(year),
        globalNote: lorem.generateParagraphs(1),
        characters: [],
        completed: true,
        chronicleId: story.chronicleId,
        storyId: story._id,
        storyTeller: story.storyTeller
    });

    for (let i = 0; i < players.length; i++) {
        session.characters.push({
            characterId: players[i].characters[0]._id,
            characterName: players[i].characters[0].name,
            experiencePoints: 3,
            storyTellerNote: lorem.generateParagraphs(1),
            playerNote: lorem.generateParagraphs(1)
        });
    }
    return await session.save();
}

async function createPlace(chronicleId, userId, players) {
    let place = new Place({
        storyTellerId: userId,
        chronicleId: chronicleId,
        title: capitalize(lorem.generateWords(1)),
        gmaps: JSON.stringify({
            formatted_address: lorem.generateSentences(1),
            geometry: {
                location: {
                    lat: getRandomCordinates(true),
                    lng: getRandomCordinates(false)
                }
            }
        }),
        playerVisibility: pickRandom(players.map((player) => {
            return {
                playerId: player._id,
                playerName: player.userDisplayName,
                playerImage: player.userPicture
            }
        }))
    });
    await place.save();
    return place;
}

